import React from "react";

function Resultpage(props) {
  let score = props.location.state.score;
  const ans = props.location.state.ans;
  const res = props.location.state.res;

  const [mqtopass, setMqtopass] = useState(1);

  useEffect(() => {
    fetch("http://127.0.0.1:3000/instructions")
      .then((res) => res.json())
      .then((results) => {
        setMqtopass(results[0].mqtopass);
      });
  }, []);
  if (ans === res) {
    score = score + 1;
  }
  return (
    <div className="container">
      <div className="box1">
        <h1>Your Score : {score}</h1>
        {score > { mqtopass } ? <h1>Passed</h1> : <h1>Fail</h1>}
      </div>
    </div>
  );
}

export default Resultpage;
